import React from 'react'
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap'


export default class Home extends React.Component {
    render () {
        return (
            <div>
                <h1>Home page</h1>

                <Form>
                    <FormGroup>
                        <Input type="text" placeholder="Enter another username to compare Spotify data" className="form-control" required></Input>
                    </FormGroup>
                </Form>
            </div>


        )
    }
}
